import React from 'react';

const addUser = ({name,email,id}) => {
    return(
        <div className='pa2'>
        <input
          className='pa3 ba b--green bg-lightest-blue'
          type='text'
          name='name'
          placeholder='Name'
          onChange={name}
        />
        <input
          className='pa3 ba b--green bg-lightest-blue'
          type='text'
          name='email'
          placeholder='Email'
          onChange={email}
        />
        <input
          className='pa3 ba b--green bg-lightest-blue'
          type='text'
          name='ID'
          placeholder='ID'
          onChange={id}
        />
        <button>Sumbet</button>
        
    </div>
    );
}

export default addUser;
